import Layout from "../components/Layout";
import Link from "next/link";

const PostLink = (props) => (
  <li>
    <Link href="/p/[id]" as={`/p/${props.id}`}>
      <a>{props.id}</a>
    </Link>
  </li>
);

export default function Index() {
  return (
    <Layout>
      <p>Hello, World!</p>
      <ul>
        <PostLink id="foo" />
        <PostLink id="bar" />
        <PostLink id="baz" />
      </ul>
    </Layout>
  );
}
